import React, { Component } from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">

      <Header/>
      <Technologies/>
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a href='#'>Home</a>
      <a href='#'>Feed</a>
      <a href='#'>News</a>
    </div>
  );
}

const Technologies = () => {
  return (
    <div>
      <ul>
        <li>ILyas1</li>
        <li>ILyas2</li>
        <li>Ilyas3</li>
      </ul>
    </div>
  );
}

export default App;
